(30,	55,	29,	55,	56,	3,	'sample-data-articles/fruit-shop-site/growers',	'com_content',	'Growers',	'growers',	'',	'<p>We search the whole countryside for the best fruit growers.</p><p><em>You can let each supplier have a page that he or she can edit. To see this in action you will need to create a user who is in the suppliers group.  </em></p><p><em>Create one page in the growers category for that user and make that supplier the author of the page. That user will be able to edit his or her page. </em></p><p><em>This illustrates the use of the Edit Own permission. </em></p>',	-2,	0,	'0000-00-00 00:00:00',	1,	'{\"category_layout\":\"\",\"image\":\"\"}',	'',	'',	'{\"author\":\"\",\"robots\":\"\"}',	882,	'2020-09-03 08:17:21',	0,	'0000-00-00 00:00:00',	0,	'*',	1),
