(75,	166,	22,	23,	24,	5,	'sample-data-articles/joomla/extensions/modules/navigation-modules',	'com_content',	'Navigation Modules',	'navigation-modules',	'',	'<p>Navigation modules help your visitors move through your site and find what they need.</p><p>Menus provide your site with structure and help your visitors navigate your site.  Although they are all based on the same menu module, the variety of ways menus are used in the sample data show how flexible this module is.</p><p>A menu can range from extremely simple (for example the top menu or the menu for the Australian Parks sample site) to extremely complex (for example the About Joomla! menu with its many levels). They can also be used for other types of presentation such as the site map linked from the \"This Site\" menu.</p><p>Breadcrumbs provide users with information about where they are in a site.</p>',	-2,	0,	'0000-00-00 00:00:00',	1,	'{\"category_layout\":\"\",\"image\":\"\"}',	'',	'',	'{\"author\":\"\",\"robots\":\"\"}',	882,	'2020-09-03 08:17:21',	0,	'0000-00-00 00:00:00',	0,	'*',	1),
(76,	167,	29,	57,	58,	3,	'sample-data-articles/fruit-shop-site/recipes',	'com_content',	'Recipes',	'recipes',	'',	'<p>Customers and suppliers can post their favorite recipes for fruit here.</p><p>A good idea is to promote the use of metadata keywords to make finding other recipes for the same fruit easier.</p><p><em>To see this in action, create a user assigned to the customer group and a user assigned to the suppliers group. These users will be able to create their own recipe pages and edit those pages. They will not be able to edit other users\' pages.</em><br /><br /></p>',	-2,	0,	'0000-00-00 00:00:00',	1,	'{\"category_layout\":\"\",\"image\":\"\"}',	'',	'',	'{\"author\":\"\",\"robots\":\"\"}',	882,	'2020-09-03 08:17:21',	0,	'0000-00-00 00:00:00',	0,	'*',	1),
