(17,	'index.php?option=com_content&view=category&id=22',	'index.php?option=com_content&view=category&id=22',	'Modules',	' Modules are small blocks of content that can be displayed in positions on a web page. The menus on this site are displayed in modules. The core of Joomla! includes 24 separate modules ranging from login to search to random images. Each module has a name that starts mod_ but when it displays it has a title. In the descriptions in this section, the titles are the same as the names. ',	'2020-09-11 07:33:26',	'736da628ec8d32f8f092718f061dc22f',	1,	1,	1,	'*',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	2,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:19:{s:2:\"id\";s:2:\"22\";s:5:\"alias\";s:7:\"modules\";s:7:\"summary\";s:389:\"<p>Modules are small blocks of content that can be displayed in positions on a web page. The menus on this site are displayed in modules. The core of Joomla! includes 24 separate modules ranging from login to search to random images. Each module has a name that starts mod_ but when it displays it has a title. In the descriptions in this section, the titles are the same as the names.</p>\";s:9:\"extension\";s:11:\"com_content\";s:10:\"created_by\";s:3:\"882\";s:8:\"modified\";s:19:\"2020-09-03 08:17:21\";s:11:\"modified_by\";s:3:\"882\";s:7:\"metakey\";s:0:\"\";s:8:\"metadesc\";s:0:\"\";s:8:\"metadata\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:6:\"author\";s:0:\"\";s:6:\"robots\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:3:\"lft\";s:2:\"14\";s:9:\"parent_id\";s:2:\"20\";s:5:\"level\";s:1:\"4\";s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:15:\"category_layout\";s:0:\"\";s:5:\"image\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:4:\"slug\";s:10:\"22:modules\";s:4:\"mime\";N;s:6:\"layout\";s:8:\"category\";s:10:\"metaauthor\"