(19,	'index.php?option=com_content&view=category&id=24',	'index.php?option=com_content&view=category&id=24',	'Languages',	' Joomla! installs in English, but translations of the interfaces, sample data and help screens are available in dozens of languages. Help Translation information If there is no language pack available for your language, instructions are available for creating your own translation, which you can also contribute to the community by starting a translation team to create an accredited translation. Translations of the interfaces are installed using the extensions manager in the site administrator and then managed using the language manager. If you have two or more languages installed you may enable the language switcher plugin and module. They should always be used together. If you create multilingual content and mark your content, menu items or modules as being in specific languages and follow the complete instructions your users will be able to select a specific content language using the module. By default both the plugin and module are disabled. Joomla 2.5 installs with a language override manager that allows you to change the specific words (such as Edit or Search) used in the Joomla application. There are a number of extensions that can help you manage translations of content available in the Joomla! Extensions Directory. ',	'2020-09-11 07:33:26',	'c7601f84d747d7b3b89faa182c355adf',	1,	1,	1,	'*',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	2,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:19:{s:2:\"id\";s:2:\"24\";s:5:\"alias\";s:9:\"languages\";s:7:\"summary\";s:1580:\"<p>Joomla! installs in English, but translations of the interfaces, sample data and help screens are available in dozens of languages. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Extensions_Language_Manager_Installed\">Help</a></p><p><a href=\"https://community.joomla.org/translations.html\">Translation information</a></p><p>If there is no language pack available for your language, instructions are available for creating your own translation, which you can also contribute to the community by starting a translation team to create an accredited translation.</p><p>Translations of the interfaces are installed using the extensions manager in the site administrator and then managed using the language manager.</p><p>If you have two or more languages installed you may enable the language switcher plugin and module. They should always be used together. If you create multilingual content and mark your content, menu items or modules as being in specific languages and follow <a href=\"https://docs.joomla.org/Special:MyLanguage/Language_Switcher_Tutorial\">the complete instructions</a> your users will be able to select a specific content language using the module. By default both the plugin and module are disabled.</p><p>Joomla 2.5 installs with a language override manager that allows you to change the specific words (such as Edit or Search) used in the Joomla application.</p><p>There are a number of extensions that can help you manage translations of content available in the<a href=\"https://extensions.joomla.org/\"> Joomla! Extensions Directory</a>.</p>\";s:9:\"extension\";s:11:\"com_content\";s:10:\"created_by\";s:3:\"882\";s:8:\"modified\";s:19:\"2020-09-03 08:17:21\";s:11:\"modified_by\";s:3:\"882\";s:7:\"metakey\";s:0:\"\";s:8:\"metadesc\";s:0:\"\";s:8:\"metadata\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:6:\"author\";s:0:\"\";s:6:\"robots\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:3:\"lft\";s:2:\"32\";s:9:\"parent_id\";s:2:\"20\";s:5:\"level\";s:1:\"4\";s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:15:\"category_layout\";s:0:\"\";s:5:\"image\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:4:\"slug\";s:12:\"24:languages\";s