(22,	'index.php?option=com_content&view=category&id=27',	'index.php?option=com_content&view=category&id=27',	'Park Blog',	' Here is where I will blog all about the parks of Australia. You can make a blog on your website by creating a category to write your blog posts in (this one is called Park Blog). Each blog post will be an article in that category. If you make a category blog menu link with 1 column it will look like this page, if you display the category description then this part is displayed. To enhance your blog you may want to add extensions for comments, interacting with social network sites, tagging, and keeping in contact with your readers. You can also enable the syndication that is included in Joomla (in the Integration Options set Show Feed Link to Show and make sure to display the syndication module on the page). ',	'2020-09-11 07:33:27',	'ed9e0a6096eb778557bc5f049d3575b0',	1,	1,	1,	'en-GB',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	2,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:19:{s:2:\"id\";s:2:\"27\";s:5:\"alias\";s:9:\"park-blog\";s:7:\"summary\";s:1355:\"<p><span style=\"font-size: 12px;\">Here is where I will blog all about the parks of Australia.</span></p><p><em>You can make a blog on your website by creating a category to write your blog posts in (this one is called Park Blog). Each blog post will be an article in that category. If you make a category blog menu link with 1 column it will look like this page, if you display the category description then this part is displayed. </em></p><p><em>To enhance your blog you may want to add extensions for <a href=\"https://extensions.joomla.org/extensions/contacts-and-feedback/articles-comments\" style=\"color: #1b57b1; text-decoration: none; font-weight: normal;\">comments</a>,<a href=\"https://extensions.joomla.org/category/social-web\" style=\"color: #1b57b1; text-decoration: none; font-weight: normal;\"> interacting with social network sites</a>, <a href=\"https://extensions.joomla.org/category/content-sharing\" style=\"color: #1b57b1; text-decoration: none; font-weight: normal;\">tagging</a>, and <a href=\"https://extensions.joomla.org/category/marketing\" style=\"color: #1b57b1; text-decoration: none; font-weight: normal;\">keeping in contact with your readers</a>. You can also enable the syndication that is included in Joomla (in the Integration Options set Show Feed Link to Show and make sure to display the syndication module on the page).</em></p>\";s:9:\"extension\";s:11:\"com_content\";s:10:\"created_by\";s:3:\"882\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:7:\"metakey\";s:0:\"\";s:8:\"metadesc\";s:0:\"\";s:8:\"metadata\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:6:\"author\";s:0:\"\";s:6:\"robots\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:3:\"lft\";s:2:\"39\";s:9:\"parent_id\";s:2:\"26\";s:5:\"level\";s:1:\"3\";s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:15:\"category_layout\";s:0:\"\";s:5:\"image\";s:41:\"images/sampledata/parks/banner_cradle.jpg\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:4:\"slug\";s:12:\"27:park-blog\";s:4:\"mime\";N;s:6:\"layout\";s:8:\"category\";s:10:\"metaauthor\";N;s:4:\"path\";s:75:\"/using-joomla/extensions/components/content-component/article-category-blog\";}s:15:\"\0*\0instructions\";a:5:{i:1;a:3:{i:0;s:5:\"title\";i:1;s:8:\"subtitle\";i:2;s:2:\"id\";}i:2;a:2:{i:0;s:7:\"summary\";i:1;s:4:\"body\";}i:3;a:8:{i:0;s:4:\"meta\";i:1;s:10:\"list_price\";i:2;s:10:\"sale_price\";i:3;s:4:\"link\";i:4;s:7:\"metakey\";i:5;s:8:\"metadesc\";i:6;s:10:\"metaauthor\";i:7;s:6:\"author\";}i:4;a:2:{i:0;s:4:\"path\";i:1;s:5:\"alias\";}i:5;a:1:{i:0;s:8:\"comments\";}}s:11:\"\0*\0taxonomy\";a:2:{s:4:\"Type\";a:1:{s:8:\"Category\";O:27:\"Joomla\\CMS\\Object\\CMSObject\":4:{s:10:\"\0*\0_errors\";a:0:{