(29,	'index.php?option=com_contact&view=category&id=37',	'index.php?option=com_contact&view=category&id=37',	'Fruit Encyclopedia',	' Our directory of information about different kinds of fruit. We love fruit and want the world to know more about all of its many varieties. Although it is small now, we work on it whenever we have a chance. All of the images can be found in Wikimedia Commons. This encyclopedia is implemented using the contact component, each fruit a separate contact and a category for each letter. A CSS style is used to create the horizontal layout of the alphabet headings. If you wanted to, you could allow some users (such as your growers) to have access to just this category in the contact component and let them help you to create new content for the encyclopedia. ',	'2020-09-16 08:59:12',	'5386eca594436ce2adee89dc5850998b',	1,	0,	1,	'*',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	2,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:18:{s:2:\"id\";s:2:\"37\";s:5:\"alias\";s:18:\"fruit-encyclopedia\";s:7:\"summary\";s:885:\"<p> </p><p>Our directory of information about different kinds of fruit.</p><p>We love fruit and want the world to know more about all of its many varieties.</p><p>Although it is small now, we work on it whenever we have a chance.</p><p>All of the images can be found in <a href=\"https://commons.wikimedia.org/wiki/Main_Page\">Wikimedia Commons</a>.</p><p><img src=\"images/sampledata/fruitshop/apple.jpg\" border=\"0\" alt=\"Apples\" title=\"Apples\" /></p><p><em>This encyclopedia is implemented using the contact component, each fruit a separate contact and a category for each letter. A CSS style is used to create the horizontal layout of the alphabet headings. </em></p><p><em>If you wanted to, you could allow some users (such as your growers) to have access to just this category in the contact component and let them help you to create new content for the encyclopedia.</e