(64,	'index.php?option=com_content&view=category&id=76',	'index.php?option=com_content&view=category&id=76',	'Recipes',	' Customers and suppliers can post their favorite recipes for fruit here. A good idea is to promote the use of metadata keywords to make finding other recipes for the same fruit easier. To see this in action, create a user assigned to the customer group and a user assigned to the suppliers group. These users will be able to create their own recipe pages and edit those pages. They will not be able to edit other users\' pages. ',	'2020-09-16 07:33:35',	'05edd6bf9e2e436d820a0ec9adf3ebe2',	1,	0,	1,	'*',	'0000-00-00 00:00:00',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	2,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:18:{s:2:\"id\";s:2:\"76\";s:5:\"alias\";s:7:\"recipes\";s:7:\"summary\";s:465:\"<p>Customers and suppliers can post their favorite recipes for fruit here.</p><p>A good idea is to promote the use of metadata keywords to make finding other recipes for the same fruit easier.</p><p><em>To see this in action, create a user assigned to the customer group and a user assigned to the suppliers group. These users will be able to create their own recipe pages and edit those pages. They will not be able to edit other users\' pages.</em><br /><br /></p>\";s:9:\"extension\";s:11:\"com_content\";s:10:\"created_by\";s:3:\"882\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:7:\"metakey\";s:0:\"\";s:8:\"metadesc\";s:0:\"\";s:8:\"metadata\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:6:\"author\";s:0:\"\";s:6:\"robots\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"separator\";s:1:\".\";}s:3:\"lft\";s:2:\"57\";s:9:\"parent_id\";s:2:\"29\";s:5:\"level\";s:1:\"3\";s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":2:{s:15:\"category_layout\";s:0:\"\";s:5:\"image\";s:0:\"\";}s:14:\"\0*\0initialized\";b:1;s:9:\"sep