nd put it in the Joomla category. You can edit an existing article by clicking on the edit icon (this only displays to users who have the right to edit). Learn more There is much more to learn about how to use Joomla! to create the website you envision. You can learn much more at the Joomla! documentation site and on the Joomla! forums. \";s:9:\"published\";N;s:5:\"state\";i:0;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2020-09-03 08:17:21\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2020-09-03 08:17:21\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:4;s:15:\"defaultLanguage\";s:5:\"en-GB\";}'),
