(240,	'index.php?option=com_content&view=article&id=20',	'index.php?option=com_content&view=article&id=20:fruit-shop&catid=29',	'Fruit Shop',	' Welcome to the Fruit Shop We sell fruits from around the world. Please use our website to learn more about our business. We hope you will come to our shop and buy some fruit. This mini site will show you how you might want to set up a site for a business, in this example one selling fruit. It shows how to use access controls to manage your site content. If you were building a real site, you might want to extend it with e-commerce, a catalog, mailing lists or other enhancements, many of which are available through the Joomla! Extensions Directory. To understand this site you will probably want to make one user with group set to customer and one with group set to grower. By logging in with different privileges you can see how access control works. ',	'2020-09-16 07:54:22',	'13dd3852922a5712d3ef70a76555c290',	1,	0,	1,	'*',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	4,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:26:{s:2:\"id\";s:2:\"20\";s:5:\"alias\";s:10:\"fruit-shop\";s:7:\"summary\";s:853:\"<h2>Welcome to the Fruit Shop</h2><p>We sell fruits from around the world. Please use our website to learn more about our business. We hope you will come to our shop and buy some fruit.</p><p><em>This mini site will show you how you might want to set up a site for a business, in this example one selling fruit. It shows how to use access controls to manage your site content. If you were building a real site, you might want to extend it with e-commerce, a catalog, mailing lists or other enhancements, many of which are available through the</em><a href=\"http://extensions.joomla.org/\"><em> Joomla! Extensions Directory</em></a>.</p><p><em>To understand this site you will probably want to make one user with group set to customer and one with group set to grower. By logging 