(258,	'index.php?option=com_content&view=article&id=48',	'index.php?option=com_content&view=article&id=48:the-joomla-project&catid=19',	'The Joomla! Project',	' The Joomla Project consists of all of the people who make and support the Joomla Web Platform and Content Management System. Our mission is to provide a flexible platform for digital publishing and collaboration. The core values are: Freedom Equality Trust Community Collaboration Usability In our vision, we see: People publishing and collaborating in their communities and around the world Software that is free, secure, and high-quality A community that is enjoyable and rewarding to participate in People around the world using their preferred languages A project that acts autonomously A project that is socially responsible A project dedicated to maintaining the trust of its users There are millions of users around the world and thousands of people who contribute to the Joomla Project. They work in three main groups: the Production Working Group, responsible for everything that goes into software and documentation; the Community Working Group, responsible for creating a nurturing the community; and Open Source Matters, the non profit organization responsible for managing legal, financial and organizational issues. Joomla is a free and open source project, which uses the GNU General Public License version 2 or later. ',	'2020-09-16 07:55:06',	'aeeeade1f5cde4887e2372216cb2448c',	1,	0,	1,	'*',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	4,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:26:{s:2:\"id\";s:2:\"48\";s:5:\"alias\";s:18:\"the-joomla-project\";s:7:\"summary\";s:1392:\"<p>The Joomla Project consists of all of the people who make and support the Joomla Web Platform and Content Management System.</p><p>Our mission is to provide a flexible platform for digital publishing and collaboration.</p><p>The core values are:</p><ul><li>Freedom</li><li>Equality</li><li>Trust</li><li>Community</li><li>Collaboration</li><li>Usability</li></ul><p>In our vision, we see:</p><ul><li>People publishing and collaborating in their communities and around the world</li><li>Software that is free, secure, and high-quality</li><li>A community that is enjoyable and rewarding to participate in</li><li>People around the world using their preferred languages</li><li>A project that acts autonomously</li><li>A project that is socially responsible</li><li>A project dedicated to maintaining the trust of its users</li></ul><p>There are millions of users around the world and thousands of people who contribute to the Joomla Project. They work in three main groups: the Production Working Group, responsible for everything that goes into software and documentation; the Community Working Group, responsible for creating a nurturing the community; and Open Source Matters, the non profit organization responsible for managing legal, financial and organizational issues.</p><p>Joomla is a free and open source project, which uses the GNU General Public License version 2 or later.</p>\";s:4:\"body\";s:0:\"\";s:6:\"images\";s:173:\"{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}\";s:5:\"catid\";s:2:\"19\";s:10:\"created_by\";s:3:\"882\";s:16:\"created_by_alias\";s:6:\"Joomla\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":83:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"1\";s:19:\"info_block_position\";s:1:\"0\";s:21:\"info_block_show_title\";s:1:\"1\";s:13:\"show_category\";s:1:\"1\";s:13:\"link_category\";s:1:\"1\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s