(264,	'index.php?option=com_content&view=article&id=39',	'index.php?option=com_content&view=article&id=39:search-component&catid=21',	'Search',	' Joomla! 2.5 offers two search options. The Basic Search component provides basic search functionality for the information contained in your core components. Many extensions can also be searched by the search component. Help The Smart Search component offers searching similar to that found in major search engines. Smart Search is disabled by default. If you choose to enable it you will need to take several steps. First, enable the Smart Search Plugin in the plugin manager. Then, if you are using the Basic Search Module replace it with the Smart Search Module. Finally, if you have already created content, go to the Smart Search component in your site administrator and click the Index icon. Once indexing of your content is complete, Smart Search will be ready to use. Help. ',	'2020-09-16 07:55:07',	'827f17d3db766a664ef07d5029f94258',	1,	0,	1,	'*',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	4,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:26:{s:2:\"id\";s:2:\"39\";s:5:\"alias\";s:16:\"search-component\";s:7:\"summary\";s:885:\"<p>Joomla! 2.5 offers two search options.</p><p>The Basic Search component provides basic search functionality for the information contained in your core components. Many extensions can also be searched by the search component. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Components_Search\">Help</a></p><p>The Smart Search component offers searching similar to that found in major search engines. Smart Search is disabled by default. If you choose to enable it you will need to take several steps. First, enable the Smart Search Plugin in the plugin manager. Then, if you are using the Basic Search Module replace it with the Smart Search Module. Finally, if you have already created content, go to the Smart Search component 