(324,	'index.php?option=com_content&view=article&id=47',	'index.php?option=com_content&view=article&id=47:the-joomla-community&catid=19',	'Archived Post 1',	' Joomla means All Together, and it is a community of people all working and having fun together that makes Joomla possible. Thousands of people each year participate in the Joomla community, and we hope you will be one of them. ',	'2020-09-16 08:52:25',	'e292fe588a62402c055ea726baa071bf',	1,	0,	1,	'*',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	'2020-09-03 08:17:21',	'0000-00-00 00:00:00',	0,	0,	4,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:26:{s:2:\"id\";s:2:\"47\";s:5:\"alias\";s:20:\"the-joomla-community\";s:7:\"summary\";s:235:\"<p>Joomla means All Together, and it is a community of people all working and having fun together that makes Joomla possible. Thousands of people each year participate in the Joomla community, and we hope you will be one of them.</p>\r\n\";s:4:\"body\";s:584:\"\r\n<p>People with all kinds of skills, of all skill levels and from around the world are welcome to join in. Participate in the <a href=\"https://www.joomla.org/\">Joomla.org</a> family of websites (the<a href=\"https://forum.joomla.org/\"> forum </a>is a great place to start). Come to a <a href=\"https://community.joomla.org/events.html\">Joomla! event</a>. Join or start a <a href=\"https://community.joomla.org/user-groups.html\">Joomla! Users Group</a>. Whether you are a developer, site administrator, designer, end user or fan, there are ways for you to participate and contribute.</p>\";s:6:\"images\";s:173:\"{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}\";s:5:\"catid\";s:2:\"19\";s:10:\"created_by\";s:3:\"882\";s:16:\"created_by_alias\";s:6:\"Joomla\";s:8:\"modified\";s:19:\"2020-09-15 04:34:54\";s:11:\"modified_by\";s:3:\"882\";s:6:\"params\";O:2