(390,	'index.php?option=com_content&view=article&id=101',	'index.php?option=com_content&view=article&id=101:search&catid=14',	'Search',	' Joomla! 2.5 offers two search options. The Basic Search component provides basic search functionality for the information contained in your core components. Many extensions can also be searched by the search component. Help The Smart Search component offers searching similar to that found in major search engines. Smart Search is disabled by default. If you choose to enable it you will need to take several steps. First, enable the Smart Search Plugin in the plugin manager. Then, if you are using the Basic Search Module replace it with the Smart Search Module. Finally, if you have already created content, go to the Smart Search component in your site administrator and click the Index icon. Once indexing of your content is complete, Smart Search will be ready to use. Help. ',	'2020-09-17 02:03:35',	'8a64ca4ff080ae29f121c78c667e2b2e',	1,	1,	1,	'*',	'2020-09-17 02:03:35',	'0000-00-00 00:00:00',	'2020-09-17 02:03:35',	'0000-00-00 00:00:00',	0,	0,	4,	'O:19:\"FinderIndexerResult\":19:{s:11:\"\0*\0elements\";a:26:{s:2:\"id\";s:3:\"101\";s:5:\"alias\";s:6:\"search\";s:7:\"summary\";s:890:\"<p>Joomla! 2.5 offers two search options.</p>\r\n<p>The Basic Search component provides basic search functionality for the information contained in your core components. Many extensions can also be searched by the search component. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help38:Components_Search\">Help</a></p>\r\n<p>The Smart Search component offers searching similar to that found in major search engines. Smart Search is disabled by default. If you choose to enable it you will need to take several steps. First, enable the Smart Search Plugin in the plugin manager. Then, if you are using the Basic Search Module replace it with the Smart Search Module. Finally, if you have already created content, go to the Smart Search component in your site administrator and click the Index icon. Once indexing of your content is complete, Smart Search will be ready to use. Help.</p>\";s:4:\"body\";s:0:\"\";s:6:\"images\";s:173:\"{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}\";s:5:\"catid\";s:2:\"14\";s:10:\"created_by\";s:3:\"882\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2020-09-17 02:03:35\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:24:\"Joomla\\Registry\\Registry\":3:{s:7:\"\0*\0data\";O:8:\"stdClass\":83:{s:14:\"article_layout\";s:9:\"_:default\";s:10:\"show_title\";s:1:\"1\";s:11:\"link_titles\";s:1:\"1\";s:10:\"show_intro\";s:1:\"1\";s:19:\"info_block_position\";s:1:\"0\";s:21:\"info_block_show_title\";s:1:\"1\";s:13:\"show_category\";s:1:\"1\";s:13:\"link_category\";s:1:\"1\";s:20:\"show_parent_category\";s:1:\"0\";s:20:\"link_parent_category\";s:1:\"0\";s:17:\"show_associations\";s:1:\"0\";s:5:\"flags\";s:1:\"1\";s:11:\"show_author\";s:1:\"1\";s:11:\"link_author\";s:1:\"0\";s:16:\"show_create_date\";s:1:\"0\";s:16:\"show_modify_date\";s:1:\"0\";s:17:\"show_publish_date\";s:1:\"1\";s:20:\"show_item_navigation\";s:1:\"1\";s:9:\"show_vote\";s:1:\"0\";s:13:\"show_readmore\";s:1:\"1\";s:19:\"show_readmore_title\";s:1:\"1\";s:14:\"readmore_limit\";s:3:\"100\";s:9:\"show_tags\";s:1:\"1\";s:10:\"show_icons\";s:1:\"1\";s:15:\"show_print_icon\";s:1:\"1\";s:15:\"show_email_icon\";s:1:\"0\";s:9:\"show_hits\";s:1:\"1\";s:11:\"record_hits\";s:1:\"1\";s:11:\"show_noauth\";s:1:\"0\";s:13:\"urls_position\";s:1:\"0\";s:7:\"captcha\";s:0:\"\";s:23:\"show_publishing_options\";s:1:\"1\";s:20:\"show_article_options\";s:1:\"1\";s:12:\"save_history\";s:1:\"1\";s:13:\"history_limit\";i:10;s:25:\"show_urls_images_frontend\";s:1:\"0\";s:24:\"show_urls_images_backend\";s:1:\"1\";s:7:\"targeta\";i:0;s:7:\"targetb\";i:0;s:7:\"targetc\";i:0;s:11:\"float_intr