(25,	62,	1,	'',	'2020-09-08 06:58:26',	882,	2783,	'456765aafc6406a926b03d23f2607e3aeb4818a3',	'{\"id\":62,\"asset_id\":\"160\",\"title\":\"Content\",\"alias\":\"content-plugins\",\"introtext\":\"<p>Content plugins run when specific kinds of pages are loaded. They do things ranging from protecting email addresses from harvesters to creating page breaks.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Default on:<\\/p>\\r\\n<ul>\\r\\n<li>Email Cloaking <a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Email_Cloaking\\\">Help<\\/a><\\/li>\\r\\n<li>Load Module <a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Load_Modules\\\">Help<\\/a><\\/li>\\r\\n<li>Page Break <a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Pagebreak\\\">Help<\\/a><\\/li>\\r\\n<li>Page Navigation<a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Page_Navigation\\\"> Help<\\/a><\\/li>\\r\\n<li>Vote <a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit#Content_-_Vote\\\">Help<\\/a><\\/li>\\r\\n<\\/ul>\",\"state\":1,\"catid\":\"25\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-08 06:58:26\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-08 06:58:01\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,