(26,	24,	1,	'',	'2020-09-08 07:01:54',	882,	2351,	'7ae7b25d37ad83a4463623624990ed317f1cd340',	'{\"id\":24,\"asset_id\":\"122\",\"title\":\"Joomla!\",\"alias\":\"joomla\",\"introtext\":\"<p>Congratulations! You have a Joomla site! Joomla makes it easy to build a website just the way you want it and keep it simple to update and maintain.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Joomla is a flexible and powerful platform, whether you are building a small site for yourself or a huge site with hundreds of thousands of visitors. Joomla is open source, which means you can make it work just the way you want it to.<\\/p>\\r\\n<p>The content in this installation of Joomla has been designed to give you an in depth tour of Joomla\'s features.<\\/p>\",\"state\":1,\"catid\":\"19\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-08 07:01:54\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-08 07:01:33\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/popunder.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/popunder.png\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"0\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":4,\"ordering\":\"2\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"0\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"1\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}',	0),
(27,	8,	1,	'',	'2020-09-08 07:02:18',	882,	3683,	'328de9673e738b0da4b33226e0cecaa23f93e82f',	'{\"id\":8,\"asset_id\":\"104\",\"title\":\"Beginners\",\"alias\":\"beginners\",\"introtext\":\"<p>If this is your first Joomla! site or your first website, you have come to the right place. Joomla will help you get your website up and running quickly and easily.<\\/p>\\r\\n<p>Start off using your site by logging in using the administrator account you created when you installed Joomla.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Explore the articles and other resources right here on your site data to learn more about how Joomla works. (When you\'re done reading, you can delete or archive all of this.) You will also probably want to visit the Beginners\' Areas of the <a href=\\\"https:\\/\\/docs.joomla.org\\/Special:MyLanguage\\/Beginners\\\">Joomla documentation<\\/a> and <a href=\\\"https:\\/\\/forum.joomla.org\\/\\\">support forums<\\/a>.<\\/p>\\r\\n<p>You\'ll also want to sign up for the Joomla Security Mailing list and the Announcements mailing list. For inspiration visit the <a href=\\\"https:\\/\\/showcase.joomla.org\\/\\\">Joomla! Site Showcase<\\/a> to see an amazing array of ways people use Joomla to tell their stories on the web.<\\/p>\\r\\n<p>The basic Joomla installation will let you get a great site up and running, but when you are ready for more features the power of Joomla is in the creative ways that developers have extended it to do all kinds of things. Visit the <a href=\\\"https:\\/\\/extensions.joomla.org\\/\\\">Joomla! Extensions Directory<\\/a> to see thousands of extensions that can do almost anything you could want on a website. Can\'t find what you need? You may want to find a Joomla professional in the <a href=\\\"https:\\/\\/resources.joomla.org\\/\\\">Joomla! Resource Directory<\\/a>.<\\/p>\\r\\n<p>Want to learn more? Consider attending a <a href=\\\"https:\\/\\/community.joomla.org\\/events.html\\\">Joomla! Day<\\/a> or other event or joining a local <a href=\\\"https:\\/\\/community.joomla.org\\/user-groups.html\\\">Joomla! Users Group<\\/a>. Can\'t find one near you? Start one yourself.<\\/p>\",\"state\":1,\"catid\":\"19\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-08 07:02:18\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-08 07:01:56\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/popunder.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/popunder.png\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\