(28,	50,	1,	'',	'2020-09-08 07:02:42',	882,	2131,	'a612eea39652fbcb2ef88a4bfb6a23da42e865c9',	'{\"id\":50,\"asset_id\":\"148\",\"title\":\"Upgraders\",\"alias\":\"upgraders\",\"introtext\":\"<p>If you are an experienced Joomla! user, this Joomla site will seem very familiar but also very different.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>The biggest change is the new administrator interface and the adoption of responsive design. Hundreds of other improvements have been made.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"19\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-08 07:02:42\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-08 07:02:20\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/popunder.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/popunder.png\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"0\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_i