(70,	26,	1,	'',	'2020-09-15 04:22:18',	882,	2961,	'1b6385dd78df2d77d707ae888123724b73713b56',	'{\"id\":26,\"asset_id\":\"124\",\"title\":\"Blog Post 3\",\"alias\":\"language-switcher\",\"introtext\":\"<p>The language switcher module allows you to take advantage of the language tags that are available when content, modules and menu links are created.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>This module displays a list of available Content Languages for switching between them.<\\/p>\\r\\n<p>When switching languages, it redirects to the Home page, or associated menu item, defined for the chosen language. Thereafter, the navigation will be the one defined for that language.<\\/p>\\r\\n<p><strong>The language filter plugin must be enabled for this module to work properly.<\\/strong><\\/p>\\r\\n<p><a title=\\\"Language Switcher Module\\\" href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Module_Manager_Language_Switcher\\\">Help<\\/a><\\/p>\\r\\n<p>To view an example of the language switch moduler module, go to the site administrator and enable the language filter plugin and the language switcher module labelled \\\"language switcher\\\" and visit the fruit shop or park sample sites. Then follow<a href=\\\"https:\\/\\/docs.joomla.org\\/Special:MyLanguage\\/Language_Switcher_Tutorial_for_Joomla_1.6\\\"> the instructions in this tutorial<\\/a>.<\\/p>\",\"state\":1,\"catid\":\"27\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-15 04:22:18\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-15 04:22:08\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/hd1080.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/hd1080.png\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt