(79,	68,	1,	'',	'2020-09-15 04:30:47',	882,	2649,	'eb8bf35a3d4feffecb57130caf05d10bce79445c',	'{\"id\":68,\"asset_id\":\"170\",\"title\":\"Featured Post 6\",\"alias\":\"captcha\",\"introtext\":\"<p>The Captcha plugins are used to prevent spam submissions on your forms such as registration, contact and login.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>You basic installation of Joomla includes one Captcha plugin which leverages the ReCaptcha\\u00ae service but you may install other plugins connecting to different Captcha systems.<\\/p>\\r\\n<p>Default on:<\\/p>\\r\\n<ul>\\r\\n<li>ReCaptcha <a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Extensions_Plugin_Manager_Edit\\\">help<\\/a><\\/li>\\r\\n<\\/ul>\\r\\n<p>Note: ReCaptcha is a the trademark of Google Inc. and is an independent product not associated with or endorsed by the Joomla Project. You will need to register and agree to the Terms of Service at Recaptcha.net to use this plugin. Complete instructions are available if you edit the ReCaptcha plugin in the Plugin Manager.<\\/p>\",\"state\":1,\"catid\":\"80\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-15 04:30:47\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-15 04:30:29\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/dummy.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/hd1080.png\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\