(80,	47,	1,	'',	'2020-09-15 04:34:54',	882,	2629,	'0cd9f315ea53464cced1d5fee8461171d33fd3ad',	'{\"id\":47,\"asset_id\":\"145\",\"title\":\"Archived Post 1\",\"alias\":\"the-joomla-community\",\"introtext\":\"<p>Joomla means All Together, and it is a community of people all working and having fun together that makes Joomla possible. Thousands of people each year participate in the Joomla community, and we hope you will be one of them.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>People with all kinds of skills, of all skill levels and from around the world are welcome to join in. Participate in the <a href=\\\"https:\\/\\/www.joomla.org\\/\\\">Joomla.org<\\/a> family of websites (the<a href=\\\"https:\\/\\/forum.joomla.org\\/\\\"> forum <\\/a>is a great place to start). Come to a <a href=\\\"https:\\/\\/community.joomla.org\\/events.html\\\">Joomla! event<\\/a>. Join or start a <a href=\\\"https:\\/\\/community.joomla.org\\/user-groups.html\\\">Joomla! Users Group<\\/a>. Whether you are a developer, site administrator, designer, end user or fan, there are ways for you to participate and contribute.<\\/p>\",\"state\":2,\"catid\":\"19\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-15 04:34:54\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-15 04:34:32\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"3\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"1\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}',	0),
(81,	67,	1,	'',	'2020-09-15 04:35:21',	882,	3095,	'3852a9a0f5884802238c56b89ede2210f6eecf3f',	'{\"id\":67,\"asset_id\":\"168\",\"title\":\"Archived Post 2\",\"alias\":\"whats-new-in-15\",\"introtext\":\"<p>This article deliberately archived as an example.<\\/p>\\r\\n<p>As with previous releases, Joomla! provides a unified and easy-to-use framework for delivering content for Web sites of all kinds. To support the changing nature of the Internet and emerging Web technologies, Joomla! required substantial restructuring of its core functionality and we also used this effort to simplify many challenges within the current user interface. Joomla! 1.5 has many new features.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p style=\\\"margin-bottom: 0in;\\\">In Joomla! 1.5, you\'\'ll notice:<\\/p>\\r\\n<ul>\\r\\n<li>Substantially improved usability, manageability, and scalability far beyond the original Mambo foundations<\\/li>\\r\\n<li>Expanded accessibility to support internationalisation, double-byte characters and right-to-left support for Arabic, Farsi, and Hebrew languages among others<\\/li>\\r\\n<li>Extended integration of external applications through Web services<\\/li>\\r\\n<li>Enhanced content delivery, template and presentation capabilities to support accessibility standards and content delivery to any destination<\\/li>\\r\\n<li>A more sustainable and flexible framework for Component and Extension developers<\\/li>\\r\\n<li>Backward compatibility with previous releases of Components, Templates, Modules, and other Extensions<\\/li>\\r\\n<\\/ul>\",\"state\":2,\"catid\":\"9\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-15 04:35:21\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-15 04:35:04\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/dummy.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"0\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"0\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}',	0),
(82,	32,	1,	'',	'2020-09-15 04:36:08',	882,	2573,	'58b0a6e86b7b8884d1a410f4dcdb948d2ed7c286',	'{\"id\":32,\"asset_id\":\"130\",\"title\":\"Archived Post 3\",\"alias\":\"options\",\"introtext\":\"<p>As you make your Joomla! site you will control the details of the display using <em>options<\\/em> also referred to as <em>parameter<\\/em><strong>s<\\/strong>. Options control everything from whether the author\'s name is displayed to who can view what to the number of items shown on a list.<\\/p>\\r\\n<p>Default options for each component are changed using the Options button on the component toolbar.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Options can also be set on an individual item, such as an article or contact and in menu links.<\\/p>\\r\\n<p>If you are happy with how your site looks, it is fine to leave all of the options set to the defaults that were created when your site was installed. As you become more experienced with Joomla you will use options more.<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":2,\"catid\":\"19\",\"created\":\"2020-09-03 08:17:21\",\"created_by\":\"882\",\"created_by_alias\":\"Joomla\",\"modified\":\"2020-09-15 04:36:08\",\"modified_by\":\"882\",\"checked_out\":\"882\",\"checked_out_time\":\"2020-09-15 04:35:46\",\"publish_up\":\"2020-09-03 08:17:21\",\"publish_down\":\"\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/dummy.png\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/hd1080.png\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\