(188,	101,	1,	'',	'2020-09-17 02:03:35',	882,	2660,	'b878ffe60ae0c5b0a5be71d098e988454f55110c',	'{\"id\":101,\"asset_id\":253,\"title\":\"Search\",\"alias\":\"search\",\"introtext\":\"<p>Joomla! 2.5 offers two search options.<\\/p>\\r\\n<p>The Basic Search component provides basic search functionality for the information contained in your core components. Many extensions can also be searched by the search component.\\u00a0<a href=\\\"https:\\/\\/help.joomla.org\\/proxy\\/index.php?keyref=Help38:Components_Search\\\">Help<\\/a><\\/p>\\r\\n<p>The Smart Search component offers searching similar to that found in major search engines. Smart Search is disabled by default. If you choose to enable it you will need to take several steps. First, enable the Smart Search Plugin in the plugin manager. Then, if you are using the Basic Search Module replace it with the Smart Search Module. Finally, if you have already created content, go to the Smart Search component in your site administrator and click the Index icon. Once indexing of your content is complete, Smart Search will be ready to use. Help.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"14\",\"created\":\"2020-09-17 02:03:35\",\"created_by\":\"882\",\"created_by_alias\":\"\",\"modified\":\"2020-09-17 02:03:35\",\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":\"2020-09-17 02:03:35\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title